  }

  render() {
    return (
      <>
        <HeaderWrapper>COWIN SLOTS</HeaderWrapper>
        <Row2Wrapper>
            <Col2Wrapper>
              {data.map(obj => 
                <Card 
                  centerName={obj.centerName}
                  centeAddress={obj.centeAddress}
                  ageGroup={obj.ageGroup}
                  vaccineName={obj.vaccineName}
                  vaccinePrice={obj.vaccinePrice}
                  dose1Qty={obj.dose1Qty}
                />
              )}
            </Col2Wrapper>
            <Col2Wrapper>
              <Modi/>
            </Col2Wrapper>
        </Row2Wrapper>
      </>
    );
  }
}

export default App;
